import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';

class ContactNumberFormComponent extends Component {
    constructor(props) {
        super(props);
        this.handleChange = this.handleChange.bind(this);
        this.state = {
            value: "",
            primary_number: "",
            secondary_number: "",

        };
    }


    handleChange = (e) => {
        const {name, value} = e.target;
        this.setState({[name] : value});

        let  childFamilyData= { contactData :{
            primary_number: this.state.primary_number,
            secondary_number: this.state.secondary_number,
            }
        };
        this.props.onSelectedChild(childFamilyData);
    };

    render() {
        return (
            <div>
                 <p><label>Primary number</label><input  onChange={this.handleChange} name="primary_number" id="primary_number" type="text"/></p>
                 <p><label>Secondary number</label><input  onChange={this.handleChange} name="secondary_number" id="secondary_number" type="text"/></p>
            </div>
        )
    }
}
export default ContactNumberFormComponent ;
